package ConditionalAndLoops;

public class RelationalAndLogicalOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=10, b=10;
		System.out.println(a<b);
		System.out.println(a>b);
		System.out.println(a==b);
		System.out.println(a!=b);
		System.out.println(a<=b);
		System.out.println(a>=b);
		
		
		System.out.println(a>10 && b>10);
		System.out.println(a>10 || b>10);
		System.out.println(!(a>b));

	}

}
